import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import VoitureServices from "../../services/VoitureServices"; // Corrected the import to match your service
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import axios from 'axios';

export default function AddCar() {
    const [clientId, setClientId] = useState('');  // User id for the car
    const [marque, setMarque] = useState('');
    const [model, setModel] = useState('');
    const [matricule, setMatricule] = useState('');
    const [car, setCar] = useState({
        marque: "",
        model: "",
        matricule: ""
    });
    const [users, setUsers] = useState([]);  // State to store list of users
    const [selectedUser, setSelectedUser] = useState('');  // State to store the selected user
    const navigate = useNavigate();

    useEffect(() => {
        // Fetch users from the backend when the component is mounted
        axios.get('http://localhost:8888/voitures/users')  // Adjust URL for fetching users
            .then((response) => {
                setUsers(response.data);  // Assuming response.data contains the list of users
            })
            .catch((error) => {
                console.error("Error fetching users:", error);
                toast.error("Erreur lors de la récupération des utilisateurs.", {
                    position: "top-right",
                    autoClose: 3000,
                    hideProgressBar: false,
                    closeOnClick: true,
                    pauseOnHover: true,
                    draggable: true,
                });
            });
    }, []);

    const handleSave = (e) => {
        e.preventDefault();

        // Add selectedUser to car object if needed
        const updatedCar = { ...car, clientId: selectedUser };

        VoitureServices.saveVoiture(updatedCar, selectedUser)
            .then(() => {
                navigate('/');
                toast.success('Voiture ajoutée avec succès!', {
                    position: "top-right",
                    autoClose: 3000,
                    hideProgressBar: false,
                    closeOnClick: true,
                    pauseOnHover: true,
                    draggable: true,
                });
            })
            .catch(error => {
                console.error("Erreur d'enregistrement :", error);
                toast.error("Erreur lors de l'enregistrement ...!!", {
                    position: "top-right",
                    autoClose: 3000,
                    hideProgressBar: false,
                    closeOnClick: true,
                    pauseOnHover: true,
                    draggable: true,
                });
            });
    };

    return (
        <div>
            <h3>Ajout d'une nouvelle voiture</h3>
            <form onSubmit={handleSave}>
                <div className="form-group">
                    <label>Marque</label>
                    <input
                        type="text"
                        value={car.marque}
                        className="form-control"
                        onChange={(e) => setMarque(e.target.value)}
                        required
                    />
                </div>

                <div className="form-group">
                    <label>Modèle</label>
                    <input
                        type="text"
                        value={car.model}
                        className="form-control"
                        onChange={(e) => setModel(e.target.value)}
                        required
                    />
                </div>

                <div className="form-group">
                    <label>Matricule</label>
                    <input
                        type="text"
                        value={car.matricule}
                        className="form-control"
                        onChange={(e) => setMatricule(e.target.value)}
                        required
                    />
                </div>

                <div className="form-group">
                    <label>Utilisateur</label>
                    <select
                        value={selectedUser}
                        onChange={(e) => setSelectedUser(e.target.value)}
                        className="form-control"
                        required
                    >
                        <option value="">Sélectionner un utilisateur</option>
                        {users.map((user) => (
                            <option key={user.id} value={user.id}>
                                {user.name}  {/* Assuming 'name' is the user name */}
                            </option>
                        ))}
                    </select>
                </div>

                <button type="submit" className="btn btn-primary">Ajouter la voiture</button>
            </form>
            <ToastContainer />
        </div>
    );
}
